import React from "react";
import { Navbar, Container, Nav } from "react-bootstrap";
const Header = () => {
  return (
    <div>
      <Navbar bg="dark" variant="dark" collapseOnSelect expand="sm">
        <Container>
          <Navbar.Brand href="#home">Ratna Nidhi</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#features">Mission</Nav.Link>
            <Nav.Link href="#pricing">About US</Nav.Link>
          </Nav>
          </Navbar.Collapse>
        </Container>
        
      </Navbar>

      <div className="display-3 text-center mt-4">Mission Million Books </div>
    </div>
  );
};
export default Header;
